import { Component, OnInit } from '@angular/core';
import { JhiLanguageService } from 'ng-jhipster';
import { MenuItem, Message } from 'primeng/components/common/api';

@Component({
    selector: 'jhi-menubar',
    templateUrl: './menubardemo.component.html',
    styles: []
})
export class MenuBarDemoComponent implements OnInit {
    activeIndex = 0;
    msgs: Message[] = [];
    private items: MenuItem[];

    ngOnInit() {
        this.items = [
            {
                label: 'File',
                icon: 'fa-file-o',
                items: [
                    {
                        label: 'New',
                        icon: 'fa-plus',
                        items: [{ label: 'File' }, { label: 'Directory' }]
                    },
                    { label: 'Open' },
                    { label: 'Close' }
                ]
            },
            {
                label: 'Edit',
                icon: 'fa-edit',
                items: [
                    { label: 'Cut', icon: 'fa-cut' },
                    { label: 'Copy', icon: 'fa-copy' },
                    { label: 'Paste', icon: 'fa-paste' },
                    { label: 'Undo', icon: 'fa-mail-forward' },
                    { label: 'Redo', icon: 'fa-mail-reply' },
                    {
                        label: 'Find',
                        icon: 'fa-search',
                        items: [{ label: 'Find Next' }, { label: 'Find Previous' }]
                    }
                ]
            },
            {
                label: 'View',
                icon: 'fa-question',
                items: [
                    {
                        label: ''
                    },
                    {
                        label: 'Tool windows',
                        icon: 'fa-search',
                        items: [
                            {
                                label: 'Project',
                                items: [
                                    {
                                        label: 'Workspace'
                                    }
                                ]
                            },
                            {
                                label: 'Run'
                            }
                        ]
                    }
                ]
            },
            {
                label: 'Help',
                icon: 'fa-question',
                items: [
                    {
                        label: 'Contents'
                    },
                    {
                        label: 'Search',
                        icon: 'fa-search',
                        items: [
                            {
                                label: 'Text',
                                items: [
                                    {
                                        label: 'Workspace'
                                    }
                                ]
                            },
                            {
                                label: 'File'
                            }
                        ]
                    }
                ]
            }
        ];
    }
    onChangeStep(label: string) {
        this.msgs.length = 0;
        this.msgs.push({ severity: 'info', summary: label });
    }
}
